import { MDBCarousel, MDBCarouselItem } from 'mdb-react-ui-kit';
import { MDBCarouselInner } from 'mdbreact';
import React from 'react';


export default function Slider() {
    return (
        <MDBCarousel showControls>
            <MDBCarouselInner className="rounded-5 shadow-4-strong">
                <MDBCarouselItem className='active'>
                    <MDBCarouselItem src='https://mdbootstrap.com/img/new/slides/041.webp' alt='...' />
                </MDBCarouselItem>
                <MDBCarouselItem>
                    <MDBCarouselItem src='https://mdbootstrap.com/img/new/slides/042.webp' alt='...' />
                </MDBCarouselItem>
                <MDBCarouselItem>
                    <MDBCarouselItem src='https://mdbootstrap.com/img/new/slides/043.webp' alt='...' />
                </MDBCarouselItem>
            </MDBCarouselInner>
        </MDBCarousel>

    );
}
